import React,{Component} from 'react';
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';
import ListGroup from 'react-bootstrap/ListGroup'

class TodoList extends Component {
    constructor(){
        super()
        this.state = {
            listOfTodos:['Todo1','ewfsdd']
        }
    }

    render(){
        return (
            <div className="">
                <div>Todo list to keep me bussy </div>
                <Form inline>
                    <Form.Control placeholder='Todo'></Form.Control>
                    <Button type="submit">Add</Button>
                </Form>
                <div>
                <ListGroup>
                 {
                  this.state.listOfTodos.map((value,idx)=>{
                return <ListGroup.Item key={idx}> {value} </ListGroup.Item>
                })}
               </ListGroup>
                </div>
            </div>
        )
    }
}
export default TodoList
